import React, { Component } from 'react';
import UserModal from './userModal';
import UserList from './userList';

class UserIndex extends React.Component {
  constructor(props){
    super(props);
    Firebase.initializeApp(config.firebase);

    this.state = {
      developers: []
    }
  }
};

export default UserIndex;
